/**
 *  "YYYYMMDD HH:mm:ss" 
 * @author zhongjyuan
 * @param {number} timezoneOffset -  +8 
 * @returns {string} 
 */
function formatTimeZoneDateTime(timezoneOffset) {
	//  Date 
	var currentDate = new Date();
	if (timeDifference) {
		currentDate = new Date(currentDate.getTime() + timeDifference);
	}

	// 
	var localTimeInMilliseconds = currentDate.getTime();

	//  UTC 
	var timezoneOffsetInMilliseconds = currentDate.getTimezoneOffset() * 60000;

	//  UTC 
	var utcTimeInMilliseconds = localTimeInMilliseconds + timezoneOffsetInMilliseconds;

	// 
	var localTime = new Date(utcTimeInMilliseconds + 3600000 * timezoneOffset);

	// 
	var year = localTime.getFullYear();
	var month = localTime.getMonth() + 1;
	var day = localTime.getDate();
	var hours = localTime.getHours();
	var minutes = localTime.getMinutes();
	var seconds = localTime.getSeconds();

	// 0 1 
	var dayOfWeek = localTime.getDay();
	var weekDay = ["", "", "", "", "", "", ""];
	var weekdayStr = weekDay[dayOfWeek];

	// 
	var startOfYear = new Date(year, 0, 0);
	var currentDayOfYear = Math.floor((localTime - startOfYear) / (24 * 60 * 60 * 1000));
	var currentWeek = Math.ceil((currentDayOfYear + 1) / 7);

	// 
	return {
		type1: `${year}${month}${day}`,
		type2: `${hours}:${minutes}:${seconds}`,
		type3: `${year}${month}${day} ${weekdayStr} ${hours}:${minutes}:${seconds}`,
		type4: `${year}${month}${day} ${currentWeek} ${weekdayStr} ${hours}:${minutes}:${seconds}`,
		type5: `${year}${month}${day} ${currentWeek} ${weekdayStr}`,
		type6: localTime.getTime(),
		type7: `${timezoneOffset} ${localTime.toDateString()} ${localTime.toTimeString().split(" ")[0]}`,
	};
}

/**
 *  "YYYY-MM-DD HH:mm:ss" 
 * @author zhongjyuan
 * @param {Date} now - 
 * @returns {string} 
 */
function formatDateTime(now) {
	// 
	let year = now.getFullYear();

	// 
	let month = (now.getMonth() + 1).toString().padStart(2, "0");

	// 
	let date = now.getDate().toString().padStart(2, "0");

	// 
	let hour = now.getHours().toString().padStart(2, "0");

	// 
	let minute = now.getMinutes().toString().padStart(2, "0");

	// 
	let second = now.getSeconds().toString().padStart(2, "0");

	// 
	return `${year}-${month}-${date} ${hour}:${minute}:${second}`;
}

