function displaySlideshow() {
	// 
	const slideshowContainer = document.querySelector(".header-right");

	// 
	const images = [
		{ name: "logo", path: "", data: base641 },
		{ name: "", path: "", data: base642 },
		{ name: "", path: "", data: base643 },
		{ name: "", path: "", data: base644 },
	]; // 

	// 
	images.forEach((image) => {
		if (image.path) {
			// 
			const imgElement = document.createElement("img");
			imgElement.src = image.path;
			imgElement.title = image.name;
			imgElement.classList.add("header-right-slideshow-slide");
			slideshowContainer.appendChild(imgElement);
		} else if (image.data) {
			// base64
			const imgElement = document.createElement("img");
			imgElement.src = image.data;
			imgElement.title = image.name;
			imgElement.classList.add("header-right-slideshow-slide");
			slideshowContainer.appendChild(imgElement);
		}
	});
}

/**
 * 
 * @author zhongjyuan
 * @param {string} country - 
 * @param {string} name - 
 * @param {string} timezone - 
 * @param {string} position - 
 * @param {string} description - 
 */
function addCountryTimeCard(country, name, timezone, position, description) {
	//  card 
	var cardElement = document.createElement("div");
	cardElement.classList.add("content-" + position + "-card");
	cardElement.setAttribute("name", name);
	cardElement.setAttribute("country", country);
	cardElement.setAttribute("timezone", timezone);

	if (description) {
		cardElement.title = description;
	}

	// 
	var imageElement = document.createElement("div");
	imageElement.classList.add("content-" + position + "-card-image");
	if (country) {
		imageElement.style.backgroundImage = "url('images/" + country + ".jpg')";
	}

	// 
	var topContentElement = document.createElement("div");
	topContentElement.classList.add("content-" + position + "-card-top");
	if (country) {
		topContentElement.innerText = name + " - " + country;
	} else {
		topContentElement.innerText = name;
	}

	var bottomContentElement = document.createElement("div");
	bottomContentElement.classList.add("content-" + position + "-card-bottom");

	// 
	function updateBottomContent() {
        var dateTime = formatTimeZoneDateTime(timezone);
        cardElement.title = dateTime.type7;
		bottomContentElement.innerText = dateTime.type3;
	}

	// 
	cardElement.addEventListener("click", (event) => {
		addDateTimeInterval(
			event.currentTarget.getAttribute("country"),
			event.currentTarget.getAttribute("name"),
			event.currentTarget.getAttribute("timezone")
		);
		addTimeStampInterval(
			event.currentTarget.getAttribute("country"),
			event.currentTarget.getAttribute("name"),
			event.currentTarget.getAttribute("timezone")
		);
	});

	// 
	updateBottomContent();

	//  card 
	cardElement.appendChild(imageElement);
	cardElement.appendChild(topContentElement);
	cardElement.appendChild(bottomContentElement);

	//  card 
	var positionElement = document.querySelector(".content-" + position + "");
	positionElement.appendChild(cardElement);

	// 
	setInterval(updateBottomContent, 1000); // 1000  1 
}

/**
 * 
 * @author zhongjyuan
 * @param {string} country - 
 * @param {string} name - 
 * @param {string} timezone - 
 */
function addDateTimeInterval(country, name, timezone) {
	// 
	var nameElement = document.querySelector(".content-middle-name");

	// 
	nameElement.setAttribute("name", name);
	nameElement.setAttribute("country", country);
	nameElement.setAttribute("timezone", timezone);

	// 
	if (country) {
		nameElement.innerText = name + " - " + country;
	} else {
		nameElement.innerText = name;
	}

	// 
	var timeElement = document.querySelector(".content-middle-time");
	var dateElement = document.querySelector(".content-middle-date");

	// 
	function updateDateTimeContent() {
		var formattedDateTime = formatTimeZoneDateTime(timezone);
		timeElement.innerText = formattedDateTime.type2;
		dateElement.innerText = formattedDateTime.type5;
	}

	// 
	if (dateTimeInfoInterval) {
		clearInterval(dateTimeInfoInterval);
	}

	// 
	updateDateTimeContent();

	// 
	dateTimeInfoInterval = setInterval(updateDateTimeContent, 1000); // 1000  1 
}

/**
 * 
 * @author zhongjyuan
 * @param {string} country - 
 * @param {string} name - 
 * @param {string} timezone - 
 */
function addTimeStampInterval(country, name, timezone) {
	// 
	var timeStampElement = document.querySelector("#showSecond");

	// 
	timeStampElement.setAttribute("name", name);
	timeStampElement.setAttribute("country", country);
	timeStampElement.setAttribute("timezone", timezone);

	// 
	restartTimeStampInterval();
}

/**
 * 
 * @author zhongjyuan
 */
function restartTimeStampInterval() {
	// 
	var timeStampElement = document.querySelector("#showSecond");

	// 
	function updateTimeStampContent() {
		// 
		timeStampElement.innerHTML = Math.floor(formatTimeZoneDateTime(timeStampElement.getAttribute("timezone")).type6 / 1000);
	}

	// 
	if (timeStampInfoInterval) {
		clearInterval(timeStampInfoInterval);
	}

	// 
	updateTimeStampContent();

	// 500
	timeStampInfoInterval = setInterval(updateTimeStampContent, 500); // 500  0.5 
}

