/**
 * 
 * @author zhongjyuan
 * @param {string} type - 
 * @param {string} text - 
 * @param {string} layout - 
 */
function generate(type, text, layout) {
	// 
	$.noty.clearQueue();
	// 
	noty({
		text: text, // 
		type: type, // 
		dismissQueue: true, // 
		closeWith: ["click", "backdrop"], // 
		modal: false, // 
		layout: layout, // 
		theme: "relax", // 
		maxVisible: 1, // 
		timeout: 3000, // 
	});
}

/**
 * 
 * @author zhongjyuan
 * @param {string} text - 
 * @returns {boolean} - 
 */
function copyText(text) {
	//  textarea 
	var textarea = document.createElement("textarea");
	// 
	var currentFocus = document.activeElement;
	//  textarea 
	document.body.appendChild(textarea);
	//  textarea 
	textarea.value = text;
	//  textarea 
	textarea.focus();
	// 
	if (textarea.setSelectionRange) textarea.setSelectionRange(0, textarea.value.length);
	else textarea.select();
	// 
	try {
		var flag = document.execCommand("copy");
	} catch (eo) {
		var flag = false;
	}
	//  textarea 
	document.body.removeChild(textarea);
	// 
	currentFocus.focus();
	// 
	return flag;
}

var shiqu_data = "";
/**
 * 
 * @author zhongjyuan
 * @param {Object} obj - 
 */
function convert_timestamp(obj) {
	// 
	var js_timestamp = obj.parent().find(".js_timestamp").val();

	// 
	if (js_timestamp === undefined || js_timestamp == "") {
		generate("error", "");
		return false;
	}

	// 
	if (js_timestamp.length != 10 && js_timestamp.length != 13) {
		generate("error", "");
		return false;
	}

	// 
	let gm_mini = new Date().getTimezoneOffset() * 60 * 1000;

	// 
	let timezone = parseFloat(obj.attr("data-zone"));

	// 
	let datetime;
	if (js_timestamp.length == 10) {
		datetime = new Date(js_timestamp * 1000 + gm_mini + timezone * 60 * 60 * 1000);
	}
	if (js_timestamp.length == 13) {
		datetime = new Date(js_timestamp * 1 + gm_mini + timezone * 60 * 60 * 1000);
	}

	// 
	obj.parent().find(".js_datetime").val(formatDateTime(datetime));
}

/**
 * 
 * @author zhongjyuan
 * @param {Object} obj - 
 */
function date_get(obj) {
	// 
	let data_time = obj.parent().find(".js_date").val();

	//  "-"  "/"
	data_time = data_time.replace(/\-/g, "/");

	// 
	if (data_time === undefined || data_time == "") {
		generate("error", "");
		return;
	}

	// 
	let stamp = new Date(data_time);
	let stamp_show = Math.floor(stamp / 1000);

	// 
	let gm_mini = new Date().getTimezoneOffset() * 60;

	// 
	let timezone = parseFloat(obj.attr("data-zone"));

	// 
	stamp_show = stamp_show - gm_mini - timezone * 3600;

	// 
	obj.parent().find(".js_time_stamp").val(stamp_show);
}

/**
 * 
 * @author zhongjyuan
 */
function check_time_change() {
	// 
	let shiqu_val = $(document).find("#time_data").val();

	// 
	if (shiqu_val !== undefined && shiqu_val != shiqu_data) {
		shiqu_data = shiqu_val;

		// 
		let shiqu = parseFloat(
			$(document)
				.find("#time_data option[value='" + shiqu_val + "']")
				.attr("data-value")
		);

		// 
		$("#show_check_data .js_convert_timestamp").attr("data-zone", shiqu);
		$("#show_check_data .js_date_get").attr("data-zone", shiqu);

		// 
		$("#show_check_data .js_datetime").val("");
		$("#show_check_data .js_time_stamp").val("");

		// 
		$("#show_check_data").show();

		// 
		if ($("#show_check_data .js_timestamp").val()) {
			convert_timestamp($("#show_check_data .js_convert_timestamp"));
		}

		// 
		if ($("#show_check_data .js_date").val()) {
			date_get($("#show_check_data .js_date_get"));
		}
	}
}

